import React, { useState, useEffect } from "react";
import axios from "axios";
import Table from "../Table";
import Button from "../Button";
import styles from "./styles/OrganisationsPage.module.css";

function OrganisationsPage() {
  const [organisations, setOrganisations] = useState([]);

  useEffect(() => {
    axios
      .get("/api/organisations?tenantId=tenantid1")
      .then((response) => setOrganisations(response.data))
      .catch((error) => console.error("Error fetching organisations:", error));
  }, []);

  const handleCreate = () => {
    // Logic to create a new organisation
  };

  return (
    <div className={styles.organisationsPage}>
      <h1>Organisations</h1>
      <Button onClick={handleCreate}>Create New Organisation</Button>
      <Table data={organisations} />
    </div>
  );
}

export default OrganisationsPage;
